import React from "react";
import { Container, Row, Col } from "reactstrap";

import Slider from "../components/slider/Slider";

const home = () => {
  return (
    <>
      <section>
        <Row>
          <Col lg='12'>
            <Slider></Slider>
          </Col>
        </Row>
      </section>
      {/*                    */}
      <section>
        <Container>
          <Row>
            <Col></Col>
          </Row>
        </Container>
      </section>
    </>
  )
}

export default home
